import { useLocation } from "react-router";
import { Box, Typography, Grid } from "@mui/material";
const TicketDetails = () => {
    const { state } = useLocation();
    const { ticket } = state;
    console.log(ticket);
    return (
        <div>
            <Box sx={{textAlign: 'left', border: 1, borderColor: 'grey' }}>
                <Typography variant="h5" margin="10px">
                    {ticket.subject}
                </Typography>
            </Box>
            <Box>
                <Grid container>
                    <Grid xs={1}>
                        Here I am
                    </Grid>
                    <Grid xs={11}>
                        <Typography>{ticket.name}</Typography>
                        <Typography padding="10px">
                            {ticket.description}
                        </Typography>
                    </Grid>
                </Grid>
            </Box>
        </div>
    );
};

export default TicketDetails;
